import React from "react";
import styled from "styled-components";

const Container = styled.div`
  width: 100%;
  min-height: 100vh;
  background: #F0F1F3;
`;

export const MemberPage: React.FC = () => {
  return (
    <Container>
      <div style={{ background: "#F0F1F3", paddingTop: "54px" }}></div>
    </Container>
  );
};
